import React, { Fragment, useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Select from "react-select";

function Filter() {
  const [city, setCity] = useState("szeged");

  const handleInputChange = (value) => {
    setCity(value);
  };

  const cities = [
    { value: "szeged", label: "Szeged" },
    { value: "bp", label: "Budapest" },
  ];

  return (
    <>
      <form>
        <h4>Város</h4>
        <div>
          <Select
            autosize={true}
            value={city}
            options={cities}
            className="btn border-dark"
            name="filterWorkSheetByStatus"
            onChange={handleInputChange}
          />
        </div>
        <div>
          <h4>Irányítószám</h4>
          <select
            //value={status}
            className="btn border-dark"
            //onChange= city =
            name="filterWorkSheetByStatus"
          >
            <option>6765</option>
            <option>6978</option>
          </select>
        </div>
        <div className="form-check">
          <input
            class="form-check-input"
            type="radio"
            name="exampleRadios"
            id="exampleRadios1"
            value="option1"
            checked
          />
          <label class="form-check-label" for="exampleRadios1">
            Lakossági
          </label>
        </div>
        <div class="form-check">
          <input
            class="form-check-input"
            type="radio"
            name="exampleRadios"
            id="exampleRadios1"
            value="option1"
            checked
          />
          <label class="form-check-label" for="exampleRadios1">
            Közösségi
          </label>
        </div>
      </form>
      <div>Backendre továbbítandó: {city} </div>
    </>
  );
}

export default Filter;
